import React from "react";

function Card(props) {
  return (
    <div>
      <ul>
        {props.tems.map((e) => {
          return <li>{e.name}</li>;
        })}
      </ul>
      <button onClick={props.prev}>prev</button>
      <button onClick={props.next}>next</button>
    </div>
  );
}
export default Card;
